class Solution:
    def findMaxForm(self, strs, m, n):
        """
        :type strs: List[str]
        :type m: int
        :type n: int
        :rtype: int
        """
        dp = []
        list_s = []
        for i in range(m + 1):
            dp.append([0] * (n + 1))
        for s in strs:
            r = [0, 0]
            for i in s:
                r[int(i)] += 1
            for i in range(m, r[0] - 1, -1):
                for j in range(n, r[1] - 1, - 1):
                    dp[i][j] = max(dp[i][j], dp[i - r[0]][j - r[1]] + 1)
        return dp[m][n]


